export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click notifications button to open modal
    await page.waitForSelector('#notificationsBtn');
    await page.click('#notificationsBtn');
    await page.waitForTimeout(1000);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notifications_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notifications_modal.png'));

    // Wait for notification time elements to load
    await page.waitForSelector('.notification-time', { timeout: 5000 });

    // Extract all notification time elements
    const timeElements = await page.$$('.notification-time');
    const timestamps = [];

    // Process each time element
    for (const element of timeElements) {
      const timeText = await element.textContent();

      // Convert relative time to timestamp (e.g., "2 hours ago" to actual timestamp)
      const currentTime = new Date();
      let timestamp;

      if (timeText.includes('hour')) {
        const hours = parseInt(timeText.match(/\d+/)[0]);
        timestamp = new Date(currentTime.getTime() - (hours * 60 * 60 * 1000)).toISOString();
      } else if (timeText.includes('minute')) {
        const minutes = parseInt(timeText.match(/\d+/)[0]);
        timestamp = new Date(currentTime.getTime() - (minutes * 60 * 1000)).toISOString();
      } else if (timeText.includes('second')) {
        const seconds = parseInt(timeText.match(/\d+/)[0]);
        timestamp = new Date(currentTime.getTime() - (seconds * 1000)).toISOString();
      } else if (timeText.includes('day')) {
        const days = parseInt(timeText.match(/\d+/)[0]);
        timestamp = new Date(currentTime.getTime() - (days * 24 * 60 * 60 * 1000)).toISOString();
      } else {
        // If format is not recognized, use current time
        timestamp = currentTime.toISOString();
      }

      timestamps.push(timestamp);
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_time_extraction.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_time_extraction.png'));

    return {
      success: true,
      action: "Extracted all notification time information and converted to timestamps",
      extractedData: {
        timestamps: timestamps,
        count: timestamps.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [...screenshots, path.join(screenshotsDir, 'error.png')],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click notifications button using different selector strategy
    const notificationsBtn = await page.waitForSelector('button#notificationsBtn');
    await notificationsBtn.click();
    await page.waitForTimeout(1000); // Wait for modal animation

    // Wait for notification modal to appear using XPath
    await page.waitForSelector('div[class*="notification"][class*="modal"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract time elements using multiple selector strategies
    const timeElements = await page.$$eval('.notification-time, [class*="time"], [class*="timestamp"]', 
      elements => elements.map(el => el.textContent.trim())
    );

    // Convert time strings to timestamps
    const timestamps = timeElements.map(timeText => {
      const now = new Date();
      const timePatterns = [
        { regex: /(\d+)\s*min\s*ago/, unit: 'minutes' },
        { regex: /(\d+)\s*hr\s*ago/, unit: 'hours' },
        { regex: /(\d+)\s*day\s*ago/, unit: 'days' },
        { regex: /(\d+)\s*week\s*ago/, unit: 'weeks' }
      ];

      for (const pattern of timePatterns) {
        const match = timeText.match(pattern.regex);
        if (match) {
          const value = parseInt(match[1]);
          const result = new Date(now);
          result.setMinutes(now.getMinutes() - (pattern.unit === 'minutes' ? value : 0));
          result.setHours(now.getHours() - (pattern.unit === 'hours' ? value : 0));
          result.setDate(now.getDate() - (pattern.unit === 'days' ? value : 0));
          result.setDate(now.getDate() - (pattern.unit === 'weeks' ? value * 7 : 0));
          return result.toISOString();
        }
      }

      return timeText; // Return original text if pattern not matched
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_time_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_time_extracted.png'));

    return {
      success: true,
      action: "Extracted notification times and converted to timestamps",
      extractedData: {
        timeElements,
        timestamps
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

